import { CardHeader, Card, IconButton, DeleteOutlined } from "@mui/material";
import { React } from "react";

export default function NoteCard({ note }) {
  return (
    <div>
      <Card>
        <CardHeader
          action={
            <IconButton>
              <DeleteOutlined />
            </IconButton>
          }
        />
      </Card>
    </div>
  );
}
